import axios from 'axios'
import { DIFFIE_HELMAN, DIFFIE_HELMAN_END } from './actionTypes'

export function Dh() {
    return dispatch => {
        const DHData = {
            Dh: true
        }

    let url = 'http://localhost:8888/auth';

    let body = JSON.stringify(DHData);
    console.log(body)
    axios({
        method: 'post',
        url: url,
        data: body,
      }).then((response) => {
          console.log(response);

          let parseData = JSON.parse(JSON.stringify(response.data))
          console.log(parseData)
          dispatch(DHSuccess(parseData.data.IP, 
                             parseData.data.prime, 
                             parseData.data.generator, 
                             parseData.data.serverPublicKey
                            ))
      })
      .catch(function (error) {
          console.log(error);
      });
    }
}


export function DHSuccess(IP, prime, generator, serverPublicKey) {
    console.log("DIFFIE_HELMAN")
    return {
        type: DIFFIE_HELMAN,
        IP,
        prime,
        generator,
        serverPublicKey
    }
}
